import React from 'react';
import { Dialogs } from './components/profileContentComponents/Dialogs/Dialogs';
import { ProfileContent } from './components/profileContentComponents/ProfileContent';
import { useAppState } from './redux/state';
import {Route, Routes} from "react-router-dom";

const App: React.FC = () => {
    const { state, addPost } = useAppState();

    return (
        <div>
            <Routes>
                <Route path='PROFILE' element={<ProfileContent state={state.profilePage} addPost={addPost} />} />
                <Route path='DIALOGS/:DIALOG?' element={<Dialogs state={state.dialogsPage} />} />
            </Routes>
        </div>
    );
};

export default App;
